import { getInitialLocale } from '../translations/getInitialLocale'

import React, { useEffect } from 'react'

const Home: React.FC = () => {
  useEffect(() => {
    window.location.replace(`/${getInitialLocale()}`)
  })

  return <>Loading...</>
}

export default Home
